import { Link } from "next/link";

const Index = () => {
  return (
    <div>
      <div>
        <Link href="/about-us">
          <a>About</a>
        </Link>
      </div>
      <h2>Ouur firstsss page</h2>
    </div>
  );
};

export default Index;
